import './App.css';
import { Content } from './modules/Content'
import {Row, Col} from './modules/Row'

function App() {
  return (
    <div className="App">
      <Content container='container'>
        <Row>
          <Col col='col-md-4'> 1 of 3</Col>
          <Col col='col-md-4'> 2 of 3</Col>
          <Col col='col-md-4'> 3 of 3</Col>
        </Row>
      </Content>
    </div>
  );
}

export default App;
